import React from "react";
//import { withRouter } from 'react-router-dom';
import $ from 'jquery'; 

import "../navigation/navigation.css";

export class CommunicatorNavigation extends React.Component {

  componentDidMount() {
  }

  render() {
    return (
      //border-radius: 0px; opacity: 0.9;
      <nav id="navigation" className="navbar navbar-inverse menu-background sht-navbar navbar-fixed-top" style={{borderRadius: "0px", opacity: "0.9"}}>
      </nav>
    )
  }
}
